import React from 'react';
import Grid from '@material-ui/core/Grid';
import '../styles/Home.css';

const Home = () => (
    <Grid container spacing={3}>
        <Grid item xs={12} sm={6} className="margin-top">
            hey
        </Grid>
        <Grid item xs={12} sm={6}>
            hi
        </Grid>
    </Grid>
);

export default Home;
